Specialty_1.query:
q = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
q = filter q by !('Status' in ["Closed - Converted", "Closed - Not Converted", "New", "Rejected"]);
q = filter q by 'IsConverted' == "false";
q = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Time_Toggle_1.selection, 0, "Text2").asString()}}];
q = group q by 'HealthCloudGA_Specialty__c';
q = foreach q generate 'HealthCloudGA_Specialty__c' as 'HealthCloudGA_Specialty__c', count() as 'count';
q = order q by 'count' desc;
q = limit q 2000;

