q_A = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Time_Toggle_1.selection, 0, "Text2").asString()}}];
q_B = filter q by date('CreatedDate_Year', 'CreatedDate_Month', 'CreatedDate_Day') in [{{cell(Time_Toggle_1.selection, 0, "Text3").asString()}}];
result = group q_A by all full, q_B by all;
result = foreach result generate count(q_A) as 'Referrals for Last Days', count(q_B) as 'Referrals for Previous Days';
result = foreach result generate 'Referrals for Last Days' as 'Referrals Received', 'Referrals for Previous Days',(('Referrals for Last Days'-'Referrals for Previous Days'))/'Referrals for Previous Days' as 'Percent_Of_Change';

